// SPDX-License-Identifier: MIT

pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@hthuang/contracts/interfaces/ICrossChain.sol";
import "./CrossChain/ContractBase.sol";

import "./interfaces/IStarshipNFT.sol";
import "./interfaces/IStarport.sol";
import "./library/Bytes.sol";

uint256 constant CALLER_NOT_CROSS_CHAIN_CONTRACT = 100;

struct DiamondShard {
    string galaxy;
    address starportId;
    uint256 amount;
}

/**
 * @dev to be continued, shipType and shipLeve should be stored metadata
 */
struct StarshipInfo {
    // from star port id to collected resources on the star
    DiamondShard[] diamondShards;

    // the id of the ship, the same as the `tokenId`
    uint256 shipId;

    // the type of the ship, which determines the image of the ship
    uint16 shipType;

    // the level of the ship, which influents the collection speed of the ship
    uint16 shipLevel;
}

// Used to record the information of ships docked in the starport
struct StarshipRecord {
    // information of a ship
    StarshipInfo shipInfo;
    // the block height when arriving the star
    uint256 startBlock;
    // used to check if an element exists
    bool used;
}

/**
 * @title The contract for starport
 * @dev Implement the workflow of the star trek on one chain
 */
contract Starport is IStarport, Ownable, ContractBase {
    // Destination contract info
    struct DestnContract {
        bytes contractAddress; // destination contract address
        bytes funcName; // destination contract action name
        bool used;
    }

    // from tokenId (shipId) to the information of starships
    // to be continued, there should be a method to get docked ship info
    mapping (uint256 => StarshipRecord) public _dockedShips;

    IStarship internal _starshipNFTContract;

    // Cross-chain destination contract map
    mapping(string => mapping(string => DestnContract)) private destnContractMap;

    /**
     * @notice Returns diamond shards of a starship
     */
    function shardsOfStarship(uint256 _id) public view returns (DiamondShard[] memory shards) {
        StarshipRecord storage ship = _dockedShips[_id];
        require(ship.used, "Not docked");

        shards = new DiamondShard[](ship.shipInfo.diamondShards.length);
        for (uint i = 0; i < ship.shipInfo.diamondShards.length; i++) {
            shards[i] = ship.shipInfo.diamondShards[i];
        }
    }

    /**
     * @notice See {IStarport-dock}
     */
    function dock(Payload calldata _payload) external override returns (uint256) {
        if (msg.sender != address(crossChainContract)) {
            return CALLER_NOT_CROSS_CHAIN_CONTRACT;
        }

        (bytes memory receiver) = abi.decode(_payload.items[0].value, (bytes));
        (uint256 shipId) = abi.decode(_payload.items[1].value, (uint256));
        // to be continued, struct is not supported, so shipInfo should be expanded
        (StarshipInfo memory shipInfo) = abi.decode(abi.decode(_payload.items[2].value, (bytes)), (StarshipInfo));

        // mint ship nft first
        _starshipNFTContract.shipArrive(Bytes.bytesToAddress(receiver), shipId);

        // after successfully mint
        StarshipRecord storage newShip = _dockedShips[shipId];
        newShip.shipInfo.shipId = shipInfo.shipId;
        newShip.shipInfo.shipType = shipInfo.shipType;
        newShip.shipInfo.shipLevel = shipInfo.shipLevel;
        for (uint i = 0; i < shipInfo.diamondShards.length; i++) {
            newShip.shipInfo.diamondShards.push(shipInfo.diamondShards[i]);
        }
        newShip.startBlock = block.number;
        newShip.used = true;

        return 0;
    }

    /**
     * @notice See {IStarport-trek}
     */
    function trek(uint256 _id, bytes calldata _receiver, string calldata _toChain) public override {        
        StarshipRecord storage ship = _dockedShips[_id];
        require(ship.used, "Not docked");
        require(_starshipNFTContract.ownerOf(_id) == msg.sender, "Not owner");

        mapping(string => DestnContract) storage map = destnContractMap[_toChain];
        DestnContract storage destnContract = map["dock"];
        require(destnContract.used, "action not registered");

        // Settlement
        settleReward(_id);

        // Pack cross-chain payload
        Payload memory data;
        data.items = new PayloadItem[](3);

        // 0: to address
        PayloadItem memory item0 = data.items[0];
        item0.name = "receiver";
        item0.msgType = MsgType.Bytes;
        item0.value = abi.encode(_receiver);

        // 1: uint256 shipId;
        PayloadItem memory item1 = data.items[1];
        item1.name = "id";
        item1.msgType = MsgType.EvmU128;
        item1.value = abi.encode(uint128(_id));

        // 2: starship data
        PayloadItem memory item2 = data.items[2];
        item2.name = "starshipData";
        item2.msgType = MsgType.Bytes;
        item2.value = abi.encode(abi.encode(ship.shipInfo));

        // clear locally
        delete _dockedShips[_id];
        _starshipNFTContract.shipLeave(_id);

        // make cross chain call
        ISentMessage memory message;
        message.toChain = _toChain;
        message.session = Session(0, 0, "", "", "");
        message.content = Content(destnContract.contractAddress, destnContract.funcName, data);

        crossChainContract.sendMessage(message);
    }

    // local settlement
    function calcReward(uint256 _start_block) public view returns(uint256) {
        return (block.number > _start_block) ? (block.number - _start_block) : 0;
    }

    /**
     * @notice Settles rewards
     */
    function settleReward(uint256 _id) public {
        StarshipRecord storage ship = _dockedShips[_id];
        require(ship.used, "Not docked");

        bool found = false;
        for (uint i = 0; i < ship.shipInfo.diamondShards.length; i++) {
            if (keccak256(bytes(ship.shipInfo.diamondShards[i].galaxy)) == keccak256(bytes(crossChainContract.chainName())) &&
            ship.shipInfo.diamondShards[i].starportId == address(this)) {
                found = true;
                ship.shipInfo.diamondShards[i].amount += calcReward(ship.startBlock);
                break;
            }
        }

        if (!found) {
            ship.shipInfo.diamondShards.push(DiamondShard(
                crossChainContract.chainName(),
                address(this),
                calcReward(ship.startBlock))
            );
        }
        ship.startBlock = block.number;
    }

    /**
     * @notice Sets the address of starship NFT contract
     */
    function setStarshipNFTAddress(address _address) public onlyOwner {
        _starshipNFTContract = IStarship(_address);
    }

    /**
     * Register destination contract info
     * @param _funcName - function name to be called
     * @param _toChain - destination chain name
     * @param _contractAddress - destination contract address
     * @param _contractFuncName - contract function name
     */
    function registerDestContract(
        string calldata _funcName,
        string calldata _toChain,
        bytes calldata _contractAddress,
        bytes calldata _contractFuncName
    ) external onlyOwner {
        mapping(string => DestnContract) storage map = destnContractMap[_toChain];
        DestnContract storage destnContract = map[_funcName];
        destnContract.contractAddress = _contractAddress;
        destnContract.funcName = _contractFuncName;
        destnContract.used = true;
    }
}

